import { makeStyles } from "@mui/styles";
import { createTheme } from "@mui/material/styles";

export const theme = createTheme();

const calendarStyles = makeStyles((theme) => ({
  selectedCalendarButton: {
    color: "grey",
    borderRadius: 50,
    height: "100px",
    width: "100px",
    margin: 100,
  },

  beforeDayButton: {
    color: "blue",
  },

  todayDayButton: {
    color: "red",
  },

  afterDayButton: {
    color: "green",
    borderRadius: 1,
    font: "arial",
  },
}));

export default calendarStyles;
